SELECT motos_2.marca AS datos_copia,   MAX(motos_2.vehiculo) AS tempattrvehiculonk16626454430,   MIN(motos_2.vehiculo) AS tempattrvehiculonk5366548160,   SUM((CAST(motos_2.cols AS LONG) * CAST(motos_2.plgs AS LONG))) AS sumcalculation_1450626233922327ok,   SUM(CAST(motos_2.numanuncios AS LONG)) AS sumnumanunciosok,   CAST(EXTRACT(YEAR FROM motos_2.fecha) AS LONG) AS yrfechaok FROM motos_2 WHERE ((CAST(EXTRACT(YEAR FROM motos_2.fecha) AS LONG) = 2015) AND (motos_2.categoria = 'MOTOCICLETAS') AND (motos_2.medio = 'PRENSA')) GROUP BY motos_2.marca,   yrfechaok;
